


const randomImageUrl = ["https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQ_MJxkbhRHtVcTffezR6g0ZQDON1vqfUX0NQ&usqp=CAU", "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQgQ-OlN6rvuuLjPBpmPUSBlx0rbWOvJnI3VA&usqp=CAU", "data:image/png;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,"]

var div = $("<div>").addClass("image-box")
$("body").append(div)
div.text("Add Random Image")

$(".image-box").click(displayRandomImage)

function displayRandomImage() {
    var randomImage = randomImageUrl[Math.floor(Math.random() * randomImageUrl.length)]
    var div = $("<div>").addClass("created-box")
    $("body").append(div)
    var image = $('<img>')
    image.addClass("img")
    image.attr(`src`, randomImage)
    div.append(image);


}


